private boolean addLeafQueueIfNotExists(Set<String> leafQueues,
    String leafQueueName) {
  boolean ret = false;
  if (!leafQueues.contains(leafQueueName)) {
    ret = leafQueues.add(leafQueueName);
  }
  return ret;
}
